I => {
  I.amOnPage(`${paths.tya.validateSurname}/${appeal.appealNumber}${paths.tya.trackYourAppeal}`);
  I.see(cookiePolicy.banner.text, globalCookieMsgID);
  I.see(cookiePolicy.banner.link, globalCookieMsgID);
  I.seeCookie('seen_cookie_message');

I => {
  I.wait('2');
  I.navByClick(hearing.details.title);
  // What to expect at your hearing
  I.wait('2');
  I.see(env.renderString(hearing.expectations.content, benefitType));
  // Hearing image caption
  I.see(env.renderString(hearing.expectations.theHearingRoom.caption[appeal.benefitType]));
  // DWP
  I.see(env.renderString(hearing.expectations.dwp.content[0], benefitType));
  // Getting a decision
  I.see(env.renderString(hearing.expectations.gettingDecision.content[1], benefitType));

I => {
  // Click into 'Contact us'
  I.navByClick(contactUs.title);
  I.wait('2');
  // See the title
  I.see(contactUs.title);
  // England and Wales content
  I.see(contactUs.description);
  I.see(contactUs.openingHours);
  I.see(contactUs.englandWales.heading);
  // Scotland content
  I.see(contactUs.englandWales.phoneNumber);
  I.see(contactUs.scotland.heading);
  I.see(contactUs.scotland.phoneNumber);

I => {
  I.seeAppealDetails(appeal);
